import React from 'react';


const Weather = (props) =>{

    return(
        <div>
        { props.city &&
        <div>
       <p> Locatioon: {props.city}, {props.country}</p>
       <p> Temperature: {props.temp}</p>
       <p> Pressure: {props.pressure}</p>
       <p> Sunset: {props.sunset}</p>
       </div>
      }
      <p>{props.error}</p>
      </div>
    )


}
 
export default Weather;
